const Header = () => (
  <>
    <NavBar />
    <img
      className="md:w-full"
      src="https://res.cloudinary.com/db3njhxi0/image/upload/v1644634655/U-Dance/WhatsApp_Image_2022-02-11_at_9.56.11_PM_iwu2a1.jpg"
      alt=""
    />
    <div className="absolute inset-x-20 top-1/4 text-white">
      <h1 className="text-white text-center">U Dance</h1>
      <p>ClASESS, COURSES</p>
    </div>
  </>
);

export default Header;
